(1, 'Farmersâ€™ group seek resumption of talks on Tuesday over new farm laws', 2, 'Yadavâ€™s proposal on behalf of the protesting farmers is similar to what the farmers have earlier demanded as they continue to press the government to withdraw the recently passed laws. Farmersâ€™ groups on Saturday proposed to hold another round of talks with the Centre over the three farm bills on Tuesday, listing the demands they have outlined for the government ahead of the discussions. Farmersâ€™ rights activist and Swaraj India leader Yogendra Yadav said that the farmers are ready to hold another set of discussions at 11am on Tuesday. â€œThe first two points in our agenda for talks are modalities to repeal the three farm laws and mechanism and procedure to bring a law for providing a legal guarantee on MSP (Minimum Support Price),â€ Yadav was quoted as saying by news agency ANI. Yadavâ€™s proposal on behalf of the protesting farmers is similar to what the farmers have earlier demanded as they continue to press the government to withdraw the recently passed laws. Though the agitating farmers have demanded a legal guarantee on minimum support price, the Centre has on several occasions assured the farmers that the MSP system will not be disturbed because of the new laws. Prime Minister Narendra Modi on Saturday highlighted that the MSP system will continue to run while disbursing funds to farmers under the PM-KISAN scheme at a virtual event on Friday. â€œThe Opposition is misleading farmers regarding MSP. If farmers want to sell at MSP, they can go to mandis. If they think they are getting a price from private traders, they have the freedom,â€ Modi had said during the event. He also highlighted that farmers will continue to get assured prices for their produce under his government. Bharatiya Kisan Union chief Rakesh Tikait also said that the modalities to repeal the laws will be one of the primary points of discussion when talks resume. â€œModalities for the repeal of three farm laws and legal guarantee for MSP should be part of agenda for talks with the government,â€ Tikait was quoted as saying by news agency PTI. The government has earlier outlined that it is ready for the long haul over the farm laws and have continued assuring the farmers that the laws are reformatory in nature. The farmersâ€™ groups also said a tractor march has been scheduled on the Kundli-Manesar-Palwal highway on December 30 to protest against the farm laws. Farmer leader Darshan Pal told ANI, â€œToll plazas in Punjab and Haryana will remain permanently open. On December 30, we will organise a tractor march from Singhu border.â€', 1, '2020-12-26', 1, 1),
(2, 'Oxford Covid-19 vaccine may become the first to get Indian regulatorâ€™s nod for emergency use', 2, 'The process of granting emergency use approval for Bharat Biotechâ€™s Covid-19 vaccine â€˜Covaxinâ€™ may take time as its phase 3 trials are still underway, while Pfizer is yet to make a presentation. With preparations underway for a possible vaccine-rollout by January, the Indian drug regulator is looking at the UK, which sources believe may give its nod to the Oxford Covid-19 vaccine next week, before deciding on giving emergency use authorisation to the Serum Institute that is manufacturing the shots here. Once the UK drug regulator gives its approval to the Oxford vaccine, the expert committee on Covid-19 at the CDSCO will hold its meeting and thoroughly review the safety and immunogenicity data from the clinical evaluations conducted abroad and in India before granting any emergency authorisation for the vaccine here, official sources said.  The process of granting emergency use approval for Bharat Biotechâ€™s Covid-19 vaccine â€˜Covaxinâ€™ may take time as its phase 3 trials are still underway, while Pfizer is yet to make a presentation.  â€œGoing by this, Oxford vaccine â€˜Covishieldâ€™ is likely to be the first to be rolled out in India,â€  a source said.  Serum Institute of India (SII) last week also had submitted some additional data required by the Drug Controller General of India (DCGI), the sources said. Amid fears about the mutated variant of SARS-CoV-2 detected in the UK, government officials recently said that it will have no impact on the potential of emerging vaccines that are being developed in India and other countries.  Bharat Biotech, Serum Institute of India (SII) and Pfizer had applied to the Drugs Controller General of India  (DCGI) seeking emergency use authorisation for their Covid-19 vaccines early this month.  The subject expert committee (SEC) on Covid-19 of the Central Drugs Standard Control Organisation (CDSCO) on December 9 had sought additional safety and efficacy data for Covid-19 vaccines of SII and Bharat Biotech after deliberating upon their applications.  The application by the Indian arm of US pharmaceutical firm Pfizer was not taken up for deliberation as the company had sought more time for making a presentation before the committee. The Pfizer vaccine has already been approved by several countries including the UK, the US, and Bahrain.  While considering SIIâ€™s application, the SEC had recommended that the firm should submit an updated safety data of phase 2 and 3 clinical trials in the country, immunogenicity data from the clinical trial in the UK and India, along with the outcome of the assessment of the UK Medicines and Healthcare products Regulatory Agency (MHRA) for grant of EUA.  As for Hyderabad-based Bharat Biotech, â€œafter detailed deliberation, the committee recommended that the firm should present the safety and efficacy data from the ongoing phase 3 clinical trial in the country for further considerationâ€, the SEC had said.  The Pune-based SII, the worldâ€™s largest vaccine manufacturer, has made a collaboration with the University of Oxford and AstraZeneca to manufacture the vaccine. The SII has already manufactured 40 million doses of the vaccine, under the at-risk manufacturing and stockpiling licence from the DCGI, officials recently had said.', 2, '2020-12-26', 2, 2),
(3, 'More muscle to IAF with at least 3 more Rafales flying-in next month', 2, 'This batch of Rafale fighters will be the third set of deliveries of the French-origin aircraft to the Indian Air Force. The Indian Air Forceâ€™s solitary Rafale squadron will add more muscle with the arrival of at least three more fighter jets in January, a shot in the arm for the IAF that is grappling with a shortage of combat planes, people familiar with developments said on Saturday on the condition of anonymity. This batch of Rafale fighters will be the third set of deliveries of the French-origin aircraft to the air force, which has ordered a total of 36 warplanes (equivalent of two squadrons) at a cost of Rs 59,000 crore.  â€œAt least three Rafale jets will arrive in India next month. The dates are still being worked out. The planes will be flown to Jamnagar from France without a stopover on the way. Refuelling support will be provided by Indian and French tankers,â€ the people said.  The jets were ordered from France in September 2016 under a government-to-government deal. The delivery of the three jets in January will take the number of Rafales in the IAFâ€™s inventory to 11. The second batch of the IAFâ€™s three Rafale fighter jets had reached the Jamnagar airbase in Gujarat from France in early November before they flew to their homebase in Ambala. The first batch of five Rafale jets of the 36 ordered by the IAF reached the Ambala airbase on July 29 after a stopover at the Al Dhafra airbase near Abu Dhabi, although a formal induction ceremony took place later on September 10.  The arrival of more fighters will further boost the IAFâ€™s capability to rapidly deploy the advanced jets in the Ladakh theatre amid military tensions with China, as previously reported by Hindustan Times.  The IAF has been operating the fighter jets - equipped with advanced weapons and sensors - in the Ladakh theatre where the military is on high alert to deal with any provocation by China amid a lingering border dispute. The IAF will induct three to four jets every two months, with all the 36 planes likely to join its combat fleet by the year-end. The second Rafale squadron will be based at Hasimara in West Bengal to strengthen the IAFâ€™s capabilities in the eastern sector.  The Rafale fighters are the first imported jets to join the IAF in 23 years after the Russian Sukhoi-30 jets entered service in June 1997.  The twin-engine Rafale jets are capable of carrying out a variety of missions â€“ ground and sea attack, air defence and air superiority, reconnaissance and nuclear strike deterrence. The fighters can carry almost 10 tonnes of weapons. India-specific enhancements on the Rafales include cold engine start capability to operate from high-altitude bases, radar warning receivers, flight data recorders with storage for 10 hours of data, infrared search and track systems, jammers and towed decoys to ward off incoming missiles. ', 3, '2020-12-26', 3, 3),
(4, 'PM Modi to flag off Indiaâ€™s first â€˜driverlessâ€™ train next week.', 2, 'The train service will be operated on the Delhi Metroâ€™s Magenta Line, which connects Delhiâ€™s Janakpuri West with Noidaâ€™s Botanical Garden line. India will soon get its first driverless fully-automated Metro train and which will be flagged off by Prime Minister Narendra Modi on Monday, December 28. The announcement was made by the Delhi Metro Rail Corporation (DMRC) on Thursday evening. The train service will be operated on the Delhi Metroâ€™s Magenta Line, which connects Delhiâ€™s Janakpuri West with Noidaâ€™s Botanical Garden line. PM Modi will also launch a fully-operational National Common Mobility Card (NCMC) for travel on the Airport Express Line of Delhi Metro, DMRC said. 1. The trials for the train were started along the 20-km stretch on the Pink Line in December 2017. The trials were equipped with Unattended Train Operations (UTO) and Communication Based Train Control (CBTC) signalling systems.  2. The automatic trains will only be limited to Line 7 and Line 8 of the DMRC network as driverless train operation (DTO) or unattended train operation (UTO) modes can only be implemented on lines which came up under the Phase III expansion as these corridors are equipped with advanced signalling technology. The first driverless train will run on Line 7.  3. The train will be controlled entirely from DMRCâ€™s three command centres, without any human intervention. The Communication Based Train Control (CBTC) signalling technology will also make it possible to monitor and troubleshoot every aspect of train operations remotely and manual intervention will be required only in cases of hardware replacement. 4. At the command centres, information controllers will handle the passenger information system as well as crowd monitoring. With access to CCTV feed, all rolling stock controllers will monitor train equipment in real-time, download faults and other events captured by CCTVs and assist traffic controllers in executing commands remotely.  5. DMRC has also engaged a consultant, a consortium of Systra MVA and Systra France, for inspection and review of the entire system. ', 4, '2020-12-26', 4, 4),
(5, 'Isro releases Chandrayaan 2 orbiter data, data from payload looking for water awaited', 2, 'The lander and rover were destroyed during the attempted landing in September last year. Around sixteen months after Indiaâ€™s second mission to the moon entered the lunar orbit, the Indian Space Research Organisation (Isro) on Thursday released the first set of data from the eight instruments aboard the orbiter. Chandrayaan2 consisted of three missions clubbed together. Its orbiter would circle around the moon. The Vikram lander was to make a soft landing near the moonâ€™s south pole and the Pragyan rover to explore the lunar surface and observe water ice. The lander and rover were destroyed during the attempted landing in September last year. The surviving experiments were to provide a high-resolution topographic map of the moon, optical images, surface composition study using x-rays, x-rays emitted by the sun and its corona, mineral mapping, polarimetric measurements of the shadowed regions, the study of exosphere (thin atmosphere around the moon), and lunar charged and neutral environments.  The data for all of the missions of Isro is collected by the Indian Space Science Data Centre (ISSDC) near Bengaluru. It is prepared in the standard, globally followed Planetary Data System 4 format for the public.  This data is then peer-reviewed scientifically and technically before it is shared with the global scientific community and the general public. The data has been released through the PRADAN portal hosted by ISSDC at https://pradan.issdc.gov.in. It currently holds data sets acquired by Chandrayaan-2 payloads between September 2019 and February 2020 from seven instruments. Data sets from one of the payloads mapping minerals on the lunar surface, including water and hydroxyl, will be released later.', 5, '2020-12-26', 5, 5),
(6, 'Photography From the Year Time Stopped', 8, 'Remember when? You probably donâ€™t. In January, Jay-Z talked about how he was using Roc Nation to harness the N.F.L.â€™s power to direct energy and money to social-justice initiatives like ending police brutality. Andrea Rahal, a participant in the Miss Muslimah pageant, spoke about participating in an American rite without having to compromise her faith. In February, a coterie of veterans, gamers, history buffs and gun enthusiasts gathered in California for an immersive military simulation event. Usually, a photograph captures a moment in time and space. But this year, time and space were slippery and elastic. In the United States, things started off normally enough. January and February were sharply in focus: 2020 vision. But by March, time and space took on new implications and contexts. Time was counted in lockdown days; space, measured in increments of a safe six feet apart.  Soon the days oozed together, liquefied like a clock in a DalÃ­ painting. The weirdness and the dread and the tragedy seeped into every aspect of daily life, and of course, the photographic record of it.  Suddenly, everywhere in the world, it wasnâ€™t just about what was being photographed, but how. Subjects were masked. Photographers wore P.P.E. Images were taken at a distance â€” from down the hall, or through a glass window, or via the screen of a phone.  Before long, scenes that used to seem perfectly ordinary â€” a crowd of humans; hands touching a womanâ€™s face; an intimate portrait in a bedroom â€” were newly burdened with the weighty subtext of a new reality. Just as once upon a time we may have clutched our pearls at the sight of an ankle, weâ€™re now mildly scandalized by what was once very common social behavior. So close! Is that safe? That must be from The Before Times. Often itâ€™s intertwined with a twinge of sadness. Remember when we used to drink cocktails together? In the same room? Anxiety and loss blanket everything, and the simplest actions are steeped in fear. In May, on assignment for The New York Times, the photographer Elliot Ross sent disposable cameras to six residents of Evergreen Gardens, an assisted living facility in Colorado. One image, by 93-year-old Muriel Morgan, stands out. In front of a stone building and sliver of driveway, a woman sits in a wooden chair, her face turned toward the camera. She has a walker in front of her, and she wears sunglasses and a cloth mask that covers her nose and mouth. Beyond her, there are more wooden chairs, at clearly measured distances. One stands empty. Two others are occupied with more masked people. In the foreground, as a bouquet of balloons enters the frame, a toddler looks on from at least six feet away.  The colors produced by the film infuse a vintage aura, brushing on a veneer of nostalgia. Another time warp, another melted clock. Yet it is very much an image taken in 2020 â€” of a very 2020 situation. Last December we may not have understood it. Why is the chair in the street? Why is everyone so far apart? Why the masks? Now it all makes sense. Weâ€™ve been trained to understand a new visual language.  Sometimes when something wild and unexpected happens, we joke about a tear in the space-time continuum. As if some kind of quantum sci-fi futuristic wormhole phenomenon is the only logical explanation. Looking back on photos taken during this disrupted year, as we slide into a new one, you will not see the tiny microbe that changed everything. You will not see the photographerâ€™s protective equipment or the paranoia in the air. But you will see that we soldiered on. We kept going. The clock was melting, but it didnâ€™t stop ticking.', 6, '2020-12-26', 6, 6),
(7, 'U.K. Increasingly Isolated as U.S. Restricts Travel', 8, 'Americaâ€™s requirement that passengers coming from Britain provide negative coronavirus tests is just the latest woe to strike the country this Christmas period. It was one more reminder, delivered before dawn on Christmas morning, that Britain is not only an island nation, but one that finds itself increasingly alone.  A decision by the United States to require all airline passengers arriving from Britain to test negative for the coronavirus within 72 hours of their departure, starting on Monday, was not so much a shock as it was another bitter pill in a somber holiday season.  There is the fast spread of a coronavirus variant feared to be more contagious. Dozens of nations have barred travelers from Britain from entering. Expanded lockdowns in the country will include 48 million people by Saturday. And thousands of trucks remain stranded along Englandâ€™s coast even after France lifted a brief border blockade imposed over virus concerns. Adding to the volatility was a last-minute Brexit deal with the European Union, which kept Britain from crashing out of the bloc without an agreement in place but was all the same a painful reminder of a decision that has divided the country. Then there was Prime Minister Boris Johnsonâ€™s holiday message, which warned against â€œsnogging under the mistletoe.â€ Although a refrain of Brexit supporters was that they were driven by a desire for Britain to â€œtake back control,â€ the nationâ€™s immediate destiny is being shaped by forces beyond any individualâ€™s control â€” and perhaps none more so than the coronavirus.  The rapid spread of the virus variant â€” which government statistics indicate accounts for half of all cases currently in England â€” led to the lockdown of London and southern England this week. Starting on Saturday, it will include an even wider swath of the country, and a national lockdown has not been ruled out.  â€œI know that itâ€™s been very, very tough over the last few weeks, and, I must tell people, it will continue to be difficult,â€ Mr. Johnson said on Thursday. Many countries already require a negative coronavirus test for entry, and the new U.S. restrictions are less severe than the near total bans that about 50 nations have placed on travelers from Britain. But with the country typically serving as a connection hub for passengers traveling between Europe and the United States, it was another blow to its battered airlines, which have slashed flight after flight as governments suspended travel. The usual flood of traffic between the United States and Britain had already suffered a precipitous decline. More than 4.8 million British residents visited the United States in 2019, according to the Office of National Statistics. And whereas in February Heathrow Airport attributed over one million passengers to the North American market, since then the figure has plummeted, falling to 81,713 last month, according to data compiled by the airport.  Britainâ€™s foreign and commonwealth offices updated their travel advice on Friday to include the new testing requirement. Those looking to travel will have to provide the result of either a PCR test â€” which must be sent to a lab and can take several days to process â€” or the rapid antigen test, a relatively new tool that gives a result in about 30 minutes. With many private clinics and labs closed for Christmas on Friday, testing within the 72-hour window may prove difficult for those looking to travel immediately after the holiday. Price may also be a factor. Heathrow Airport charges about $130 for PCR results with 48 hours and about $60  for antigen tests with results within 45 minutes. Private clinics charge even more for both tests. Both tests are offered at many major British airports, including Gatwick, Manchester and London Luton as well as Heathrow. But because passengers need to register in advance for tests, it was unclear how many would be able to get one â€” and then get a result â€” in time.', 7, '2020-12-26', 7, 7),
(8, 'As Virus Resurges in Africa, Doctors Fear the Worst Is Yet to Come', 8, 'The coronavirus killed far fewer people in Africa than in Europe and the Americas, leading to a widespread perception that it was a disease of the West. Now, a tide of new cases on the continent is raising alarms. PORT ELIZABETH, South Africa â€” At the center of a terrifying coronavirus surge, 242 patients lay in row after row of beds under the soaring metal beams of a decommissioned Volkswagen factory.  Workers at the vast field hospital could provide oxygen and medications, but there were no I.C.U. beds, no ventilators, no working phones and just one physician on duty on a recent Sunday â€” Dr. Jessica Du Preez, in her second year of independent practice.  In a shed-like refrigerator behind a door marked â€œBODY HOLD,â€ carts contained the remains of three patients that morning. A funeral home had already picked up another body. On rounds, Dr. Du Preez stopped at the bed of a 60-year-old patient, a grandmother and former college counselor. Her oxygen tube had detached while she was lying prone, but the nurses had so many patients they hadnâ€™t noticed. Now, she was gone. As two porters placed her corpse in a bag, a worker peeked through the door to tell them another patient, a 67-year-old diabetic man, had died.  Meanwhile, the condition of a teacher in her 50s was deteriorating. Dr. Du Preez tried to find I.C.U. space for her elsewhere in the city, to no avail. She called the teacherâ€™s husband, who asked what he could do. â€œNot much,â€ the young doctor responded.  â€œShame,â€ she said again and again that day.  For hours, the alarm on the teacherâ€™s bedside monitor bleated. Her oxygen level was dangerously low, her pulse racing and her blood pressure soaring. Still, she remained conscious, saying she could not breathe. That evening, she died alone. A book, â€œA Heartbeat of Hope: 366 devotions,â€ lay on her bedside stand alongside a pair of reading glasses. When the pandemic began, global public health officials raised grave concerns about the vulnerabilities of Africa. But its countries overall appeared to fare far better than those in Europe or the Americas, upending scientistsâ€™ expectations. Now, the coronavirus is on the rise again in swaths of the continent, posing a new, possibly deadlier threat. In South Africa, a crush of new cases that spread from Port Elizabeth is growing exponentially across the nation, with deaths mounting. Eight countries, including Nigeria, Uganda and Mali, recently recorded their highest daily case counts all year. â€œThe second wave is here,â€ John N. Nkengasong, the head of the Africa Centers for Disease Control and Prevention, has declared. When the virus was first detected, many African countries were considered particularly at risk because they had weak medical, laboratory and disease-surveillance systems and were already battling other contagions. Some were riven by armed conflict, limiting health workersâ€™ access. In March, Tedros Adhanom Ghebreyesus, the first African director-general of the World Health Organization, cautioned, â€œWe have to prepare for the worst.â€  But many African governments pursued swift, severe lockdowns that â€” while financially ruinous, especially for their poorest citizens â€” slowed the rate of infection. Some deployed networks of community health workers. The Africa C.D.C., the W.H.O. and other agencies helped expand testing and moved in protective gear, medical equipment and pharmaceuticals. The reported toll of the pandemic on the continent â€” 2.6 million cases and 61,000 deaths, according to the Africa C.D.C. â€” is lower than what the United States alone currently experiences in three weeks.  But that accounting is almost certainly incomplete. Evidence is growing that many cases were missed, according to an analysis of new studies, visits to nearly a dozen medical institutions and interviews with more than 100 public health officials, scientists, government leaders and medical providers on the continent.  â€œIt is possible and very likely that the rate of exposure is much more than what has been reported,â€ Dr. Nkengasong said in an interview. Now, as they battle new outbreaks, doctors are convinced that deaths have also gone uncounted. Dr. John Black, the only infectious-disease specialist for adults in Port Elizabeth, said he and other physicians feared that many people were dying at home. Indeed, a government analysis showed that there had been more than twice as many excess deaths as could be explained by confirmed cases in South Africa. â€œWe donâ€™t know what the real number is,â€ he said.  Scientists are also considering other explanations for the continentâ€™s outcome. These range from the asymptomatic or mild infections more common in youth â€” the median age in Africa is just 19.7, about half that of the United States â€” to unproven factors including pre-existing immunity, patterns of mobility and climate. If those conditions helped protect against the virus earlier, officials ask, will they do so now? In South Africa, the continentâ€™s leader by far in coronavirus cases and deaths, the growing devastation in its medical system has led to the rationing of care for older adults. Last week, officials announced that a new variant of the virus that may be associated with faster transmission has become dominant. With stricter control measures lifted and many people no longer seeing the virus as a threat, public health officials fear that Africaâ€™s second wave could be far worse than its first.  â€œThe risk perception has gone from something very scary at the beginning to now something people are not worried about anymore,â€ said Dr. Chikwe Ihekweazu, director-general of the Nigeria Center for Disease Control.', 8, '2020-12-26', 8, 8),
(9, 'An Unwelcome Silent Night: Germany Without Christmas Markets', 8, 'Across the country, city and town squares stand empty of the usual huts, sounds, scents and lights, as the coronavirus has forced the country to skip its beloved annual Christmas markets. BERLIN â€” Germany this December doesnâ€™t feel right.  There are no groups of friends gripping mugs of steaming red wine spiced with cinnamon and cloves crowding Rothenburgâ€™s medieval market square, or beneath Cologneâ€™s towering cathedral. No brass bands play carols before Berlinâ€™s Charlottenburg Palace. No stars shine from the eaves of Seiffenâ€™s wooden huts.  The magical figure known as the Christkind did not spread her golden wings and welcome the world to Nurembergâ€™s annual Christmas market. The darkened city square did not spring to light, revealing, in the verse she recites annually, a â€œlittle town within the city, which of cloth and wood is made; fleeting in its brief splendor, but everlasting throughout the ages.â€ GERMANY DISPATCH  An Unwelcome Silent Night: Germany Without Christmas Markets Across the country, city and town squares stand empty of the usual huts, sounds, scents and lights, as the coronavirus has forced the country to skip its beloved annual Christmas markets.    The town of Ansbach in Bavaria allowed only a few of the usual Christmas market stands to open. The town of Ansbach in Bavaria allowed only a few of the usual Christmas market stands to open.Credit...Laetitia Vancon for The New York Times Melissa Eddy By Melissa Eddy Dec. 10, 2020 BERLIN â€” Germany this December doesnâ€™t feel right.  There are no groups of friends gripping mugs of steaming red wine spiced with cinnamon and cloves crowding Rothenburgâ€™s medieval market square, or beneath Cologneâ€™s towering cathedral. No brass bands play carols before Berlinâ€™s Charlottenburg Palace. No stars shine from the eaves of Seiffenâ€™s wooden huts.  The magical figure known as the Christkind did not spread her golden wings and welcome the world to Nurembergâ€™s annual Christmas market. The darkened city square did not spring to light, revealing, in the verse she recites annually, a â€œlittle town within the city, which of cloth and wood is made; fleeting in its brief splendor, but everlasting throughout the ages.â€  The coronavirus is muting Christmas celebrations around the world. But the absence of seasonal merriment and public cheer is particularly palpable, and painful, in Germanyâ€™s marketplaces and squares, largely devoid of their beloved Christmas markets because of the pandemic.  â€œWhen you walk through the streets of Munich or Nuremberg these days, without the bright lights and good cheer, without the smell of hot mulled wine â€” I just miss all of that,â€ said Oliver PÃ¶tzsch, 50, an author whose novels draw from his Bavarian familyâ€™s history. The locals, though, are drawn to the more intimate festivals in towns and villages across the country, often in the regions where they grew up.  â€œThey were always meeting places,â€ Margot KÃ¤ssmann, 63, a former bishop of the Lutheran Church in Germany said of the Christmas markets, also called Advent markets.  â€œToday, Christmas markets remain very social places where friends and family gather,â€ she said. â€œBut even people who are alone will go there on their own to take in the smells, the lights and the music, which have something comforting about them.â€', 9, '2020-12-26', 9, 9),
(10, 'The Brexit Fight, Through a Reporterâ€™s Prism of a Changed Continent', 8, 'Alan Cowell, a longtime New York Times correspondent, recalls a different Europe, one of currency controls, cumbersome paperwork and burdensome cross-border regulations. LONDON â€” An image from my sepia-toned memory in the 1950s: by a summery wheat field freckled with poppies in northern France, English vacationers have halted for tea. A man primes a hand-cranked paraffin stove. A battered kettle is produced, and a teapot. Driving by in their bouncy CitroÃ«n 2CVs and curvy Renault Dauphines, French motorists observe the ritual with tolerant bemusement or haughty disdain. British travelers, a rarity then, wave when they spot a kindred license plate.  It is often said â€” especially now that Prime Minister Boris Johnson has struck a post-Brexit trade deal with the European Union â€” that Britainâ€™s desire to leave the European Union is rooted in nostalgia, a hankering for the past glories of a bulldog nation. The sloganeering imagery of striking out alone, â€œtaking back control,â€ has resonated with sufficient potency for Mr. Johnson to have won an overwhelming majority in elections a year ago. Indeed, with much of the land in near lockdown, confronted by a mutant and highly transmissible variant of the coronavirus, the very idea of control has become more compelling, as if the parallel narratives of politics and pandemic have intertwined in a yearning for an indistinct and far from certain renewal. Both hinge on a notion of sovereignty that might seems at odds with a world in which economic interdependency and disease have leapfrogged national frontiers with equal and comparable ease. This week, it almost seemed as if the two had combined. Alarmed by the new variant of the virus in Britain, President Emmanuel Macron of France, himself in quarantine after testing positive for Covid-19, ordered the border closed, even as some 50 nations introduced restrictions, or outright bans, on travelers from Britain. Thousands of trucks â€” stranded in Britain as Christmas and a deadline to seal a Brexit trade deal drew close â€” snarled the approaches to the port of Dover and the nearby entrance to the Channel Tunnel. It might be a clichÃ©, but it was tempting to compare events to a perfect storm: Just as Britain was about to bid farewell to the European Union, Covid-19 had left it isolated from the world. The chaos of trucks stuck on British highways and at a former airfield in the surrounding countryside in Kent seemed to offer a foretaste, writ large, of what life outside the European Union might mean. Against such momentous upheaval, that small vignette from northern France so many years ago, when the memory of global conflict was still vivid, spoke to a different yearning.  The poppies, of course, evoked the dead of World War I, but stood for renewal after World War II. And, in its modest way, the tea-brewing family (my own) venturing onto the â€œContinentâ€ in the late 1950s was part of the cautious vanguard of rapprochement that led, in January 1973, to Britainâ€™s membership of what was then called the European Community, confirmed by a referendum two years later. Like that first ballot, a second plebiscite in 2016 was technically nonbinding but politically beyond challenge. More than half the voters â€” 52 percent â€” voted to leave, an emblem of dissatisfaction and disconnection, a chance to thumb a collective nose against the elite. But for some among the 48 percent of the voters who wished to remain in the now much larger European Union, the choice was rooted in a sense of identity and common destiny within the body that had helped cement the European peace that my fatherâ€™s generation had fought for. In the four years of fraught negotiation and politicking since then, the division has not eased. â€œLeaveâ€ became a mantra in a near-mystical evocation of Britain, as it was in the colonial era, roaming the far-flung oceans in quest of trade and prosperity, in control of its destiny, free of outsidersâ€™ trammels. The novelist David Cornwell, who wrote under the name John le CarrÃ© until his death this month, called it â€œfakeâ€ nostalgia. Yet â€œRemain,â€ too, was a siren call from a more recent past of stability and prosperity, free movement and cosmopolitanism. In saying they seek to look forward, both sides, it sometimes seems, are looking back â€” and past one another â€” with equal chromatic distortion in their rose-colored spectacles. On the plus side for the Remain camp, European Union membership came with any number of luxuries. like the little blue European Health Insurance Card giving Britons health care access to state providers in 27 countries; student exchange programs; a driverâ€™s license that was just as valid in Bologna as in Brighton. Such privileges may well turn out to be part of the sacrifice demanded by the Brexiteersâ€™ vision of a sovereign Britain set loose from the bureaucratic shackles of Brussels so that it could rise to its true destiny.', 10, '2020-12-26', 10, 10),
(11, '2020 Celebrity Christmas Cards That Deliver Holiday Cheer', 3, '\'Tis the season for professionally-lit family pictures! As 2020 draws to a close, at least we have the traditional celebrity Christmas cards to bring a little normalcy to our Instagram feeds.   This year, Kate Middleton and Prince William weren\'t the only royals to release a celebratory portrait; Meghan Markle and Prince Harry also got in on the action with an illustration of a photo recently taken by Markle\'s mom, Doria Ragland. This season\'s celebrity Christmas cards only get more festive from there.   If you need a last-minute dose of holiday cheer, stat, scroll through to see if your favorite star released a holiday pic, and as always, have a very merry Christmas and a happy new year!  Prince William and Kate Middleton Prince William, Kate Middleton, George, Charlotte, and Louis looked royally cozy wearing button-downs and sweaters. Meghan Markle and Prince Harry In sunny Los Angeles, Meghan Markle, Prince Harry, and baby Archie releasing this illustrated image to benefit the Mayhew animal rescue and clinic. Prince Charles and Camilla Love is in bloom! Prince Charles and Camilla looked relaxed and happy perching on a garden bench. The Beckhams Britain\'s unofficial royal family ran into some problems trying to get their kids and dogs to pose for a nice picture, but all\'s well that end\'s well. Posh is a pro at this stuff and got the shot.', 11, '2020-12-27', 11, 11),
(12, 'John Travolta Shares Sweet Family Video with Kids on First Christmas After Kelly Prestonâ€™s Death', 3, 'John Travolta celebrated the holidays with his family.  On Friday, the actor, 66, wished his followers a merry Christmas in a sweet video that also featured his daughter Ella Bleu, 20, and son Benjamin, 10.  â€œSay merry Christmas, Ella!â€ he said from behind the camera, as Ella posed in front of their Christmas tree in her pajamas. After sharing a greeting with a wave, Travolta then turned the camera towards his son, who was in the middle of eating a tasty treat.  â€œMerry Christmas from the Travolta family!ðŸŽ„â€ he wrote alongside the festive video.  This marked Travolta\'s first Christmas since the death of his wife Kelly Preston in July. Their son Jett died at age 16 in January 2009. Although Travolta doesnâ€™t often share photos of his children online, he did share an adorable father-son snapshot last month to celebrate Benâ€™s first double-digit birthday.  \"Happy 10th birthday my wonderful Ben! I love you!\" the actor wrote alongside a photo that showed him giving his son a hug as they smiled for the camera.  Ben\'s big sister also posted her own tribute, captioning a solo shot of the birthday boy on a boat.  \"Happy Birthday Benjamin!!!! To the sweetest boy in the world, I am so lucky to have you in my life,\" she wrote. \"Even though I am your older sister, you continue to teach me so much every day. You are my best friend and I love you to the moon and back. â¤ï¸â¤ï¸â¤ï¸â¤ï¸â¤ï¸â¤ï¸â¤ï¸â¤ï¸\" Since Preston\'s death in July, the Grease star has marked a number of milestones he would have shared with his late wife, including what would have been her 58th birthday in October.  \"Happy Birthday hon!\" he wrote alongside a photo from his 1991 wedding to Preston, which he shared alongside a shot of his own parents\' wedding. ', 12, '2020-12-27', 12, 12),
(13, 'Ariana Grande Shares Cuddly Christmas Photo with Her FiancÃ© Dalton Gomez', 3, 'Ariana Grande is feeling the holiday spirit with her fiancÃ© Dalton Gomez.  The \"34+35\" singer shared a cuddly photo with her new beau on Christmas day, captioning the Instagram post, â€œmerry :).â€  Grande, 27, also posted images from her Christmas celebrations with mom Joan, brother Frankie and some close friends.  On Christmas Eve, she tweeted out well wishes to her fans for the holiday. \"Sending so much love. I hope u all have the warmest, cosiest, healthiest holiday possible this year,\" Grande wrote. \"Whether you\'re with your loved ones in person or virtually, I hope u are able to be present & feel so much love ! ðŸ¤ðŸ¤ðŸ¤ .\"  \"Thinking of u all, please stay safe ðŸ¤ðŸ¤ & love u,\" she concluded.  This is Grandeâ€™s first Christmas with Gomez after the pair got engaged last week. \"Forever n then some,\" she captioned her post announcing the engagement on Dec. 20, including a close look at her new ring.  \"They couldn\'t be happier, they\'re just so excited. This is a happy time for them,\" a source told PEOPLE following the news. \"Both sets of parents are thrilled.\" Previously, a source confirmed that the couple had been dating since January and even socially distancing together in her Los Angeles home amid the pandemic.  \"Ariana doesn\'t want to do another public relationship so she is trying to keep this one quiet, but she seems very happy with Dalton,\" the insider said in March.  In May, soon after the lovebirds began their romance, they made their first official appearance together in the music video for \"Stuck with U,\" Grande\'s song with Justin Bieber.', 13, '2020-12-27', 13, 13),
(14, 'Kanye West Surprise-Releases â€˜Emmanuelâ€™ EP â€˜Inspired by Ancient and Latin Musicâ€™', 3, 'Last Christmas, Kanye West gifted fans with the gospel-inspired Jesus Is Born, his ninth album and first with the Sunday Service Choir. On Friday evening, the rapper-producer turned the holiday into a new tradition, releasing a five-song EP titled Emmanuel â€œinspired by ancient and Latin music.â€  Billed in a statement accompanying the surprise release as a â€œcelebration of the miracle of the birth of Jesus Christ,â€ the 12-minute EP, executive produced and composed by West, include the Christian prayer â€œRequiem Aeternamâ€ (â€œEternal Restâ€) and the choral work â€œO Magnum Mysterium.â€ The Sunday Service Choir features on the entire classical project, which prizes Gregorian chants over beat-based production. West ends the EP with his interpretation of the ubiquitous Christian hymn â€œGloria.â€ West recommitted himself to Christianity in 2019, speaking publicly about his faith and kicking off a long-running series of performances with his choir, Sunday Service. â€œWhat Iâ€™m thinking is gonna be a week or two, now Iâ€™ve been in the company of Kanye West for the last 10 months,â€ Jason White, the Sunday Service choir director, said ahead of the release of Westâ€™s 2019 album Jesus Is King. â€œIâ€™ve spent every Sunday riding with him.â€ While delving into the same spiritually minded themes, Emmanuelâ€™s brief length stands in stark contrast to the 19-song, 84-minute Jesus Is Born. The surprise release of Emmanuel, which translates to â€œGod is with us,â€ arrives with none of the drama that accompanied Jesus Is King. West had worked on his first foray into gospel until the last minute, tweeting that he was still â€œfixing mixesâ€ on three songs on the night of its supposed release. That album featured vocal contributions from Clipse, Ty Dolla $ign, Fred Hammond, and Ant Clemons, along with saxophone from Kenny G and production from Timbaland and Mike Dean, among others.', 14, '2020-12-27', 14, 14),
(15, 'Rihanna and A$AP Rocky Spend Christmas Eve Together in Barbados', 3, 'It\'s beginning to look a lot like romance...  Rihanna and A$AP Rocky spent Christmas Eve in her home country on Barbados, following months of dating rumors and random joint sightings. The 32-year-old \"Umbrella\" singer and 32-year-old rapper were photographed that day walking and holding hands on a pier on the way to a Catamaran sunset cruise with friends. Both dressed in black and wore masks.  Rihanna and Rocky flew to the Caribbean nation separately days earlier. The singer was born and raised in Barbados and her family still lives there. She also maintains a luxury beachfront home on the island.  Neither Rihanna nor Rocky have commented on the status of their relationship. The two have been friends for years and have also worked together.  They collaborated on her 2012 song \"Cockiness (Love It)\" in 2012. A year later, they toured together and Rihanna also served as A$AP\'s muse in his \"Fashion Killa\" music video. This past July, the rapper appeared in the singer\'s Fenty Skin ad campaign.  They Dated? Surprising Star Couples  Fresh speculation about a possible romance was fueled last December when they walked the red carpet together at The Fashion Awards in London. This past January, Rihanna and Rocky were also spotted laughing together backstage at the 2020 Yams Day Benefit Concert in New York City. At the same time, E! News learned that Rihanna and Saudi businessman Hassan Jameel had split after more than two years together.  In February, Rihanna and Rocky were spotted at The Nice Guy restaurant in West Hollywood, Calif. In late November, they hung out together with friends at the Beatrice Inn in New York City. Just days later, the two were seen stepping out for a stroll in the city.', 15, '2020-12-27', 15, 15),
(16, 'Volkswagen celebrates the 75th anniversary of Beetle production', 4, 'Volkswagen is celebrating the 75th anniversary of one of the most important dates in its history. Against all odds, it launched series production of the Type 1 â€” which we know as the Beetle â€” on December 27, 1945.  Prior to that date, the factory in Wolfsburg, Germany, and the Beetle both faced a grim future. Although the car was developed before World War II, only 630 units were built during the conflict as the factory shifted its attention to the war effort. It was consequently bombed by Allied forces several times during 1944. When peace returned, it would have been much easier to level the factory, scrap the Beetle, and do something else with the site. That\'s almost what happened, but the British government â€” which controlled the zone Wolfsburg was in after the war â€” desperately needed vehicles for its personnel to get around. After examining an early Beetle, officials ordered a batch of 20,000 cars from the factory in August 1945, and they doubled that number several weeks later. Initially, the goal was to produce 1,000 cars a month, meaning filling the order should have taken over three years. It likely wasn\'t lost on officials that the sizable order would keep workers in a job until at least 1948. Launching production was easier said than done; raw materials and fuel were difficult to come by, and finding ways to house and feed the workers was a logistical nightmare. Despite the hurdles, Volkswagen launched series production of the Type 1 two days after Christmas in 1945, and it built a total of 55 cars before December 31. Cars were largely assembled by hand, so the factory didn\'t reach the 1,000-cars-per-month goal until early 1946. At the time, exceeding that number wasn\'t possible due to the aforementioned shortages, but production increased significantly as the situation improved. Introducing the Beetle to the United States in 1949 dramatically increased its popularity, and it helped turn the model into an icon.', 16, '2020-12-27', 16, 16),
(17, '7 American political \'norms\' blown to smithereens in 2020', 4, 'The Trump era has been defined by its obliteration of political norms, the accepted way for the country to be governed, elections to be conducted, and political rivals to treat one another.  From Democrats whipsawing from \"Believe Women\" to \"Respect Due Process,\" to the end of political conventions as we knew them, to a reckoning on police unions\' political power, 2020 blew up political norms.  Here\'s a look back on the \"norms\" that didn\'t survive the worst year of our lifetimes.  This is an opinion column. The thoughts expressed are those of the author. The Trump era has frequently been defined by its obliteration of political norms, the accepted way for the country to be governed, elections to be conducted, and political rivals to treat one another.  Among the disregarded norms was the expectation that the president of the United States would not throw his own government\'s intelligence community under the bus while standing next to an authoritarian despot on foreign soil.  Also done away with was the norm that presidents don\'t personally profit from owning a luxury hotel down the block from the White House and use it as a hub for peddling foreign influence.  There was boring but important stuff, like the norm that Cabinet-level officials should be confirmed by the Senate, rather than allowing them to serve illegally and implement policy for years.  As the Trump era stumbles toward the exits, it\'s worth looking back at the old rules that got blasted into oblivion in 2020, including the jettisoned norms that had little to do with Trump.  The president believing he\'s responsible for administering the federal government We already knew President Donald Trump was impervious to logic and reason, so it wasn\'t shocking when he predicted COVID-19 would miraculously disappear with warm weather. But before coming into office, he did always try to fashion himself as \"the Boss.\"', 17, '2020-12-27', 17, 17);
