(18, 'Cold chain doubts delay COVID-19 vaccinations in some German cities', 4, 'FRANKFURT (Reuters) - Germany\'s coronavirus vaccination campaign faced delays in several cities on Sunday after medical staff found potential irregularities in the cooling of the shot produced by BioNTech and Pfizer.  The European Union launched a mass COVID-19 vaccination drive on Sunday with pensioners and medics lining up to get the first shots to see off a pandemic that has crippled economies and claimed more than 1.7 million lives worldwide.  \"When reading the temperature loggers that were enclosed in the cool boxes, doubts arose about the compliance with the cold chain requirements\", the District Office of Lichtenfels in the north of Germany\'s largest state Bavaria said in a statement.  The Pfizer vaccine, which uses new so-called mRNA technology, must be stored at ultra-low temperatures of about -70 degrees Celsius (-112Â°F) to remain effective before being shipped to distribution centres.  Pfizer has designed special shipping containers filled with dry ice to keep the vaccine from spoiling while in transit. Shots can be kept in an ultra-low temperature freezer for up to six months, or for five days at 2C to 8C â€“ a type of refrigeration commonly available at hospitals.  Besides Lichtenfels, the northern Bavarian cities of Coburg, Kronach, Kulmbach, Hof, Bayreuth and Wunsiedel also held off from inoculating people after uncertainty arose about whether the cold chain had been maintained.  \"Vaccination against the coronavirus is not about who vaccinates the fastest or who does the most doses. Safety and conscientious work for the benefit of the population has the highest priority\", said Oliver Baer, district administrator of the district of Hof.  Similar problems also delayed the vaccination campaign in the southern Bavarian city of Augsburg, daily Merkur reported.  Germany\'s vaccination campaign officially kicked off on Sunday with residents of elderly care homes being inoculated. The federal government is planning to distribute more than 1.3 million doses to local health authorities by the end of this year and about 700,000 per week from January.', 18, '2020-12-27', 18, 18),
(19, 'Cryptoâ€™s Choice: Join the Financial System or Fight It', 4, 'This has been an extraordinary year. Not for a century has there been a pandemic on this scale. And although far fewer people have so far died from COVID-19 than perished in the 1918-19 â€œSpanish flu,â€ the economic damage is probably far worse. Governments shut down large parts of their economies to try to prevent the virus from spreading, and borrowed heavily to support businesses that could not trade and people who couldnâ€™t work. Central banks cut interest rates to the bone and poured money into financial markets to ward off a deflationary collapse. Now, as 2020 draws to a close, returns on investment are nowhere to be found, and there are rising fears of inflation. Itâ€™s no surprise, therefore, that 2020 is ending with a cryptocurrency boom.   During 2020, the fortunes of cryptocurrencies have been determined mainly by central banks. When financial markets crashed in March, cryptocurrencies suffered an even worse fall than traditional asset classes. Bitcoiners would like us to believe that the halvening in May helped bitcoinâ€™s price to recover, but the fact is cryptocurrencies recovered as central banks poured money into financial markets. Continued infusions of fiat money caused the prices of all assets to rise, and cryptocurrencies proved to be no exception.   This post is part of CoinDeskâ€™s 2020 Year in Review â€“ a collection of op-eds, essays and interviews about the year in crypto and beyond. Frances Coppola, a CoinDesk columnist, is a freelance writer and speaker on banking, finance and economics. Her book â€œThe Case for Peopleâ€™s Quantitative Easing,â€ explains how modern money creation and quantitative easing work, and advocates â€œhelicopter moneyâ€ to help economies out of recession.  Related: Three Market Trends Fueled Enterprise DLT Adoption in 2020  Fiat money injections by central banks have particularly fuelled the rise and rise of stablecoins, the ties that bind the crypto ecosystem ever more tightly to the existing financial system. All that fiat money has had to go somewhere, and thanks to central banksâ€™ zero and negative interest rate policies, yield on conventional assets is all but non-existent. So why not have a flutter on the crypto markets, while holding an option to exit back into fiat quickly if it all goes wrong? Stablecoins may be more smoke and mirrors than a real safety net, but they seem to be giving growing numbers of people the confidence to trade cryptocurrencies. ', 19, '2020-12-27', 19, 19),
(20, 'BMW aims for 20% of its vehicles to be electric by 2023 -paper', 4, 'FRANKFURT (Reuters) - German luxury carmaker BMW is planning to step up its production of electric vehicles, Chief Executive Oliver Zipse told German daily Augsburger Allgemeine.  \"We are significantly increasing the number of electric vehicles. Between 2021 and 2023, we will build a quarter of a million more electric cars than originally planned\", Zipse told the newspaper\'s Monday edition according to a pre-released version.  BMW wants roughly every fifth car it sells to be powered by an electric engine by 2023, Zipse said, compared to about 8% this year.  The manager also reiterated his call to speed up the expansion of charging infrastructure.  \"15,000 private and about 1,300 public charging points would have to be put into operation every week as of today. Unfortunately, we are a long way from that\", he told the paper.', 20, '2020-12-27', 20, 20),
(21, 'Park rangers cite visitors to Hawaii volcano eruption site', 5, 'HONOLULU (AP) â€” Park rangers have cited dozens of people who have gathered at Hawaii Volcanoes National Park to witness an ongoing eruption of the Kilauea volcano.  The rangers said those cited had ventured into dangerous areas to take photos and videos of the volcano eruption that had created a lake of lava in its crater that was 554 feet (169 meters) deep on Thursday.  â€œAll it takes is a slight change in wind direction and these offenders could inhale a fatal dose of volcanic gas,\" said Chief Ranger Jack Corrao. \"One misstep or a crumbling cliff edge and they could plunge into the vast pit of molten rock or to the crater floor. We want to keep the park open so everyone can safely experience this beautiful new eruption, but when visitors enter closed areas, rangers must concentrate on these few individuals. This puts our staff in hazardous situations.â€  The eruption was contained in an area of the park that has been closed since 2007, and where there are dangerous levels of volcanic gas, rockfalls, explosions and volcanic glass particulates, the Honolulu Star-Advertiser reported.  Fines for violating national park rules start at $150, said Jessica Ferracane, a spokeswoman for Hawaii Volcanoes National Park. The fines increase after multiple violations and can lead to being expelled from the park.  Ferracane had told The Associated Press that a crowd of cars had lined up at the park entrance to catch a glimpse of the eruption, which began on Dec. 20.  One helicopter tour company, Paradise Helicopters, reported a substantial increase in bookings as a result of the eruption and following months of limited business due to the coronavirus pandemic.  The company had booked all of its aircraft and pilots on Monday and conducted nine flights â€” a number not seen since the pandemic began. Before March, Paradise Helicopters flew aas many as 40 flights a day, said Bronsten Kossow, the companyâ€™s operations manager.  It\'s the first time the Hawaii volcano has erupted since 2018. The two years of relative silence came after more than three decades of constant eruption from 1983 to 2018. Roughly 700 houses were destroyed during an eruption in 2018.', 21, '2020-12-27', 21, 21),
(22, 'China\'s Walvax to make COVID-19 vaccine candidate similar to AstraZeneca\'s - media', 5, 'BEIJING (Reuters) - China\'s Walvax Biotechnology Co has started work on a plant to manufacture an early-stage coronavirus vaccine candidate similar to AstraZeneca PLC\'s product, state-backed media said on Sunday.  Mass production for the proposed vaccine could begin in mid-2021, with an estimated capacity of 200 million doses a year, said Health Times, a paper run by the People\'s Daily.  The treatment is based on a chimpanzee adenovirus to deliver materials that can trigger an immune response against the virus that causes COVID-19, a technique adopted in the candidate from AstraZeneca and Oxford University.  The Chinese candidate, jointly developed by China\'s Tsinghua University and Tianjin Medical University, has not been tested on humans. The AstraZeneca-Oxford treatment is in final-stage large trials.  AstraZeneca\'s late-stage trials in Britain and Brazil last month found an efficacy of 62% for trial participants given two full doses but 90% for a subgroup given a half, then a full dose. A Reuters investigation this week revealed problems with the Oxford/AstraZeneca vaccine study.  Adenovirus is used in other COVID-19 vaccine candidates, including one from China\'s CanSino Biologics Inc, which is based a harmless common cold virus known as adenovirus type-5 (Ad5).  Researchers on the CanSino vaccine have said it might be weaker in people who had been exposed to Ad5 and have pre-existing immunity against the adenovirus.  The potential Walvax vaccine might avoid this problem by using a rare adenovirus from chimpanzees to which humans normally do not have pre-existing immunity, Health Times said.  Walvax has another production facility in the works for a vaccine it is jointly developing with the Academy of Military Science and Suzhou Abogen Biosciences Co, which is in early-stage clinical trials.  China has moved at least five vaccine candidates into late-stage clinical trials.', 22, '2020-12-27', 22, 22),
(23, 'Cambridge becomes the 1st US city to require stickers warning the threat of climate change at gas pumps', 5, 'Cambridge, Massachusetts, will require yellow stickers that warn of the harms of climate change to be posted on gas pumps, The Guardian reported.  Other US cities like California\'s Berkeley and San Francisco have proposed similar ideas in the past, but Cambridge will be the first to put the mandate into action.  Reducing gas emissions by taking public transportation or even restricting the amount you step on the gas pedal is a key way to minimize your carbon footprint.  Visit Business Insider\'s homepage for more stories.  Cambridge, Massachusetts, will require area gas pumps to post stickers warning of the harms of climate change, becoming the first US city to implement such a mandate, The Guardian reported.  The Guardian reported Friday Cambridge will require all gas pumps in the city to display bright, yellow stickers that say \"burning gasoline, diesel, and ethanol has major consequences on human health and the environment including contributing to climate change.\"   The stickers are intended to \"remind drivers to think about climate change and hopefully consider non-polluting options,\" a city spokesperson told the outlet.   In 2014, California\'s Berkeley and San Francisco proposed a similar idea to put stickers on gas pumps, but the idea wasn\'t ultimately put into action.  Reducing gas emissions by taking public transportation or even restricting the amount you step on the gas pedal is a key way to minimize your carbon footprint.  A study published in Scientific Reports earlier this year showed that even if the public worked to stop all greenhouse gas emissions, the world will continue to face climate change and global warming, Business Insider\'s Aylin Woodward previously reported.  Last year, the US greenhouse gas emissions rate dropped by 2.1%, according to the Rhodium Group, a private economic data firm. Even so, the emissions rate did not see net reductions between 2016 and 2019, according to Rhodium.', 23, '2020-12-27', 23, 23),
(24, 'How Ugandan Nasa scientist Catherine Nakalembe uses satellites to boost farming', 5, 'As a keen badminton player Ugandan Catherine Nakalembe wanted to study sport science at university but a failure to get the required grades for a government grant set her on a path that led her to Nasa and winning a prestigious food research prize, writes the BBC\'s Patience Atuhaire.  When Dr Nakalembe tried to explain to a Karamojong farmer in north-eastern Uganda how her work using images taken from satellites hundreds of kilometres above the Earth relates to his small plot, he laughed.  While she uses the high-resolution images in her pioneering work to help farmers and governments make better decisions, she still needs to get on the ground to sharpen up the data.  In other words, from space you cannot tell the difference between grass, maize and sorghum. \"Through a translator, I told the farmer that when I look at the data, I just see green.  \"I had printed a picture, which I showed him. He was then able to understand thatâ€¦ you need to see the farm physically to make those distinctions,\" the academic tells the BBC.  She is a softly spoken woman with a radiant demeanour, and it is hard to picture her trekking for hours in the heat of semi-arid Karamoja, looking to tease out the granular distinctions that can only be spotted on the ground.  This is especially important in farming areas dominated by small holders who may be planting different crops at different times, leading to a huge number of variables. That complexity makes it almost impossible for most authorities to monitor. Dr Nakalembe, an assistant professor at the University of Maryland\'s geographical sciences department in the US, uses the satellite data to study agriculture and weather patterns.  That information is combined with data gathered on the ground about the crops and their condition to build a model that learns to recognise patterns to help make predictions.  It was this that won her the 2020 Africa Food Prize alongside Burkina Faso\'s Dr AndrÃ© Bationo for his work on fertiliser.', 24, '2020-12-27', 24, 24),
(25, 'Piece of Great Pyramid Found in Scotland May Unlock Major Mystery', 5, 'When we think of Egypt we think of the Great Pyramid of Giza. Standing 455 feet tall, the largest of the Giza pyramids was built by the Pharaoh Khufu in the third millennium B.C., and has been a must-see tourist destination for the past 2,500 years. The popularity of this ancient tomb is matched only by the bafflement it inspires in its beholders. For hundreds of years, scientists and archaeologists have speculated about the ancient technologies used to build such a large structure. Some have even speculated it was built by aliens. But now, a chance discovery by a curatorial assistant at the University of Aberdeen in Scotland may help answer the question â€œHow did they build the Pyramids?â€  Towards the end of 2019, when curatorial assistant Abeer Eladany was reviewing objects in storage in the museumâ€™s Asia Collection, she came across a small, unusually decorated cigar box. An Egyptian herself, Eladany immediately noticed her countryâ€™s former flag on the boxâ€™s exterior and knew that it had no business in the Asia Collection. â€œOnce I looked into the numbers in our Egypt records,â€ she said in a university press release, â€œI instantly knew what it was, and that it had effectively been hidden in plain sight in the wrong collection.â€  Inside the box Eladany found a 5-inch piece of cedar broken into three pieces. This (formerly intact) unassuming piece of wood was one of only three itemsâ€”provocatively known as the â€˜Dixon relicsâ€™â€”that were removed from the Queenâ€™s Chamber in the Great Pyramid in the 19th century. The other two (a ball and hook), are housed in the British Museum. For the past 70 years, however, the wooden â€˜relicâ€™ was lost.  The Dixon relics were taken from the Queenâ€™s Chamber by Waynman Dixon, an engineer who explored the Great Pyramid in 1872. Their â€œdiscoveryâ€ by Dixon was widely reported by British newspapers. At the time it was obvious that the items were of great significance: a December 1872 issue of The Graphic wrote that â€œthe position in which [the relics] were left shows that they must have been left there whilst the work was going on, and at an early period of its construction.â€ The relics, the article optimistically speculated, could provide evidence â€œas to the correctness of the many theories formed by Sir Isaac Newton and others as to the weights and measures in use by the builders of the pyramids.â€', 25, '2020-12-27', 25, 25),
(26, 'Fox Sports used a Sony A7R IV to give NFL broadcasts a cinematic look', 7, 'Fox Sports used a Sony A7R IV during a broadcast to give NFL fans a more intimate and cinematic experience, according to a tweet from NFL Network reporter Mike Garafolo and article by Sports Video Group (SVG). The relatively inexpensive rig was deployed in the end zone and seamlessly intercut with the networkâ€™s broadcast cameras. Nicknamed â€œMegalodon,â€ the rig is made up of a Sony A7R IV, Sony FE 24-70mm f/2.8 GM lens, DJI Ronin-S gimbal, a field monitor and a 1080p wireless transmitter. Operator Mike Smole called it a â€œpoor manâ€™s Steadicam,â€ because the $10,000 price tag is a pittance compared to a broadcast camera and full Steadicam rig.  Fox Sports color corrected the signal to match its broadcast cameras, but otherwise itâ€™s a straight 1080p feed out of the A7R IVâ€™s micro-HDMI port. Crew members had already been using the rig to shoot tunnel walkouts and other pregame content, but Fox liked the look so much they decided to deploy it as an 11th camera for Sundayâ€™s Washington-Seattle tilt.  With the fast wide angle lens, the camera delivered a shallow depth-of-field look while Smole was able to get right next to the players as they celebrated in the end zone, as the shot above shows. â€œPeople on our crew have been working with it all year, but we didnâ€™t know your ordinary viewer would see such a difference sitting on their couch. Itâ€™s fantastic,â€ Fox SVP Mike Davies told SVG. Fox plans to use the camera rig for the rest of the year. ', 26, '2020-12-27', 26, 26),
(27, 'JAXA shows the sub-surface samples it collected from asteroid Ryugu', 7, 'Shortly after Japan\'s Hayabusa2 probe returned to Earth, JAXA showed off some of the samples it collected from asteroid Ryugu. Those rocks came from the â€œAâ€ chamber of the probeâ€™s sample capsule, which means they were collected during the missionâ€™s first touchdown in February 2019. Now, JAXA has released photos showing the contents of the capsuleâ€™s â€œCâ€ chamber, which it opened on December 21st. Mariella Moon Mariella MoonÂ·Associate Editor Sat, December 26, 2020, 7:00 AM GMT+5:30Â·1 min read  Shortly after Japan\'s Hayabusa2 probe returned to Earth, JAXA showed off some of the samples it collected from asteroid Ryugu. Those rocks came from the â€œAâ€ chamber of the probeâ€™s sample capsule, which means they were collected during the missionâ€™s first touchdown in February 2019. Now, JAXA has released photos showing the contents of the capsuleâ€™s â€œCâ€ chamber, which it opened on December 21st.   In JAXAâ€™s tweet, it said the agency opened both chambers â€œBâ€ and â€œC.â€ The â€œBâ€ chamber is empty since it wasnâ€™t used for collection, but the â€œCâ€ chamber was used to collect samples during Hayabusa2â€™s second touchdown in July 2019. JAXA fired an explosive into the asteroid before the second touchdown to create a crater and be able to gather samples from deeper underground. Scientists are hoping that the subsurface samples can offer more clues about the solar systemâ€™s formation and early period, since they hadnâ€™t been exposed to the harsh environment of space.  JAXA says the largest particles in chamber â€œCâ€ were about a centimeter in size. If you take a look at the photos, the agency marked one of the particles as â€œäººå·¥ç‰©â€ or â€œartificial object.â€ It has yet to confirm where that object came from, but JAXA believes it could be â€œaluminum separated from the sampler hornâ€ when it used an explosive on asteroid Ryuguâ€™s surface. ', 27, '2020-12-27', 27, 27),
(28, 'Best games for safely socializing this holiday season', 7, 'The holidays are usually a time to get together with family to bond but, for obvious reasons, theyâ€™re going to look a little different this year. You might be meeting outdoors, sitting six feet apart or using Zoom to chat from hundreds of miles away. So the usual family activities might need to take a backseat to more distance-friendly social video games, and weâ€™ve highlighted our favorites below. This is a weird social experience for sure, since you canâ€™t really chat while the game is in session. Everyone is on a spaceship, but only some are actually trying to run the ship while one or two are impostors out to sabotage the mission and kill everyone. The real fun begins when you call a meeting and try to figure out whoâ€™s who â€” or finger someone else as the culprit. There will be arguing and pleading and youâ€™ll probably have some trust issues, but in the end itâ€™s all in good fun, and will make for a great conversation topic for the rest of the night. Itâ€™s free on mobile so itâ€™s easy to get started. When you canâ€™t invite friends over to check out your new couch or recently remodeled kitchen, you could always have them over to your Animal Crossing island instead. Itâ€™s as easy as going over to the airport and telling the staff there youâ€™d like to open up â€” and then letting your friends know they can drop by. You can show them around your island, chat via text and give them plenty of gifts. I even know some people who create special mini-games on their islands for guests to play. But if you donâ€™t have that much time and energy, thereâ€™s still plenty of more passive activities to do together, like fishing or attending a K.K. Slider concert. The pandemic has put a real dent in board game nights, since you canâ€™t exactly meet for wild games of Monopoly and mancala. This $40 title for Nintendo Switch puts 51 different mini-games at the tip of your fingers, including dominoes, chess and air hockey. Two players can play on one system, using one Joy-Con each or the touch screen to move pieces around. But even better, up to four can link up on their own Switch consoles, with only one copy of the game between them. If you canâ€™t get together with friends in-person, you can also play with friends and strangers online.', 28, '2020-12-27', 28, 28),
(29, 'Apple is having iCloud activation problems at the worst possible time', 7, 'Youâ€™re not alone if youâ€™re having problems getting your newly gifted iPad or Apple Watch up and running. As AppleInsider first reported, Apple is warning of iCloud account and sign-in issues (ongoing as we write this) that appear to have started on Christmas Day â€” right as many people were setting up their devices for the first time. While Apple didnâ€™t say much in the alert, it told one Twitter user that â€œhigh capacityâ€ was creating problems.  Weâ€™ve asked Apple for comment.  It wouldnâ€™t be shocking if the sheer volume of gifted products was directly responsible. Device activations already tend to spike around Christmas regardless of brand. That demand could easily increase during a pandemic when people are buying tablets to talk to distant friends or smart speakers to play music while working from home.  Still, this certainly isnâ€™t great timing. It could sour the initial experience of Apple gadgets for many users, even if that feeling is likely to pass once activation works properly. Letâ€™s just hope this issue doesnâ€™t last much longer â€” and that similar issues donâ€™t affect other manufacturers. ', 29, '2020-12-27', 29, 29),
(30, 'Tesla\'s latest update turns your EV into a boombox', 7, 'Your Tesla could soon broadcast your taste in music to the world â€” if you have the right car, at least. Electrek notes that Tesla has released its promised holiday update, and the centerpiece appears to be a Boombox mode that pumps media outside as long as you have a recent-enough EV with a pedestrian speaker system, like later Model 3 production runs. You probably wonâ€™t be using this for parties during the pandemic and should check local laws, but itâ€™s more efficient (not to mention safer) than cranking up the normal volume and leaving a window open.  Elon Musk added that you can customize the horn sound on these newer cars to something beyond the usual honk. Other updates include a smarter Scheduled Departure that preconditions the battery and cabin without plugging in, larger driving visualizations (helpful for Autopilot) and at-a-glance views of the number of open stalls at Superchargers.  Musk was quick to acknowledge that the update isnâ€™t quite as â€œfireâ€ if you have a Tesla vehicle without the pedestrian speaker â€” which is many of them. Thereâ€™s â€œmore stuff comingâ€ that Tesla couldnâ€™t finish, the executive said. Still, you might appreciate the addition if Party Mode is overkill for your needs. ', 30, '2020-12-27', 30, 30),
(31, 'Two teams have inquired about Urban Meyer as head coach', 6, 'Urban Meyer has been a wildly successful head coach. Some think he could be a successful NFL coach. Some NFL teams have inquired about whether heâ€™s interested in interviewing for an NFL head-coaching job.  Adam Schefter of ESPN.com reports that at least two teams have reached out to Meyer about potentially interviewing for head-coaching jobs. Meyer intends to decide within the next week whether heâ€™s interested.  Meyer has been out of coaching for two years, but he has become a respected college football analyst with FOX. Last year, a FOX report suggested that the Browns had â€œstrong interestâ€ in Meyer. Browns owner Jimmy Haslam quickly knocked that down, saying that the Browns are focused on a coach with NFL experience. (Itâ€™s possible, frankly, that Haslamâ€™s conclusion was reached after Meyer made it known that heâ€™s not interested in the job, if he indeed did.)  Schefterâ€™s article links Meyer to the job in Jacksonville, given Meyerâ€™s connection to the University of Florida. Another team that may be doing due diligence with Meyer is the Lions, given that former Ohio State standout Chris Spielman now works for the team and advises the owner. Spielman defended Meyer in 2018, when Ohio State placed Meyer on administrative leave in connection with the Zach Smith domestic violence investigation.  â€œWell, you know, everybody around here and everybody that will see this, understands the seriousness of domestic violence and thereâ€™s nobody thatâ€™s a proponent of that,â€ Spielman said in 2018, coincidentally while visiting Lionsâ€™ training camp. â€œI know what you know. I donâ€™t know what Urban knew and when he knew it. I have no idea. I do think Ohio State had no choice to put him on paid administrative leave, until they can sort this out. . . . I know Urban and Shelley Meyer are great people and they do a lot for the community. I think Urban needs to and deserves to be heard when itâ€™s the appropriate time.â€', 31, '2020-12-27', 31, 31),
(32, 'Timberwolves hold off late rally, defeat Jazz 116-111', 6, 'SALT LAKE CITY (AP) -- Tough defense is becoming a crucial part of Minnesota\'s basketball identity.  That was evidenced by what the Timberwolves did in the closing seconds of their 116-111 victory over Utah on Saturday night.  The Jazz had a chance to set up a tying 3-pointer and force overtime with 4.2 seconds left. Minnesota did not even let it get to that point.  The Timberwolves forced Bojan Bogdanovic to commit a five-second violation on an inbounds pass. Utah got the turnover and Minnesota got the win.  \'\'We played a tough game today,\'\' center Karl-Anthony Towns said. \'\'We gutted this one out. Played great defense all around.\'\'  D\'Angelo Russell had 25 points and six assists to lead the Timberwolves. Towns added 16 points and 12 rebounds. Minnesota had five players score in double figures.  Jordan Clarkson scored 23 points and Donovan Mitchell added 21 to lead the Jazz. Mike Conley added 20 points and Rudy Gobert chipped in 18 points and 17 rebounds. Utah trailed over the final three quarters.  The Jazz rallied from a double-digit deficit and closed within 107-103 with 2:27 left on back-to-back 3-pointers from Mitchell. Russell hit a jumper and Josh Okogie cut to the basket for a dunk on Minnesota\'s next two possessions to keep Utah from erasing the Timberwolves\' lead.  Utah made it a one-possession game on Gobert\'s putback dunk with 5.9 seconds left. Russell made only 1 of 2 free throws, giving the Jazz a chance to set up a tying 3-pointer that never materialized.  \'\'They were the more aggressive team, and they took us out of our actions,\'\' Mitchell said. \'\'We couldn\'t use their aggression against them.\'\'  Anthony Edwards tallied nine of his 18 points in the first quarter.  \'\'He\'s going to continue take steps because he has a growth mindset,\'\' Timberwolves coach Ryan Saunders said. \'\'I thought he made plays within the offense too. You don\'t see that a lot from a teenager.\'\'', 32, '2020-12-27', 32, 32),
(33, 'NFL Playoff Picture: AFC & NFC standings after Week 16 Saturday games', 6, 'The NFL playoff picture is taking shape. Hereâ€™s how it looks after the latest slate of games:  AFC 1. Chiefs (13-1) Clear path to home-field advantage.  2. Bills (11-3) Clinched the AFC East, owns head-to-head tiebreaker over Steelers.  3. Steelers (11-3) Clinched playoff berth.  4. Titans (10-4) Owns the division record tiebreaker over Indianapolis.  5. Colts (10-4) Still a chance in AFC South.  6. Browns (10-4) Closing in on a return to the playoffs.  7. Dolphins (10-5) Own the last wild card.  ***  8. Ravens (9-5) Behind the Dolphins in the wild card race.  9. Raiders (7-8) Mathematically eliminated.  10. Patriots (6-8) Mathematically eliminated.  11. Broncos (5-9) Mathematically eliminated.  12. Chargers (5-9) Mathematically eliminated.  13. Texans (4-10) Mathematically eliminated.  14. Bengals (3-10-1) Mathematically eliminated.  15. Jaguars (1-13) Mathematically eliminated.  16. Jets (1-13) Mathematically eliminated.  NFC 1. Packers (11-3) Clear path to home-field advantage.  2. Saints (11-4) Clinched NFC South.  3. Seahawks (10-4) First in the NFC West.  4. Washington (6-8) Still lead the NFC East.  5. Buccaneers (10-5) Clinched wild card berth.  6. Rams (9-5) Big game coming against the Seahawks in the NFC West.  7. Cardinals (8-7) Half-game lead for the final wild card.  ***  8. Bears (7-7) Still alive for the wild card and owns the tiebreaker over Arizona.  9. Vikings (6-9) Mathematically eliminated.  10. Lions (5-10) Mathematically eliminated.  11. Cowboys (5-9) Still not out of it in the NFC East.  12. 49ers (6-9) Mathematically eliminated.  13. Giants (5-9) Still not out of it in the NFC East.  14. Eagles (4-9-1) Still not out of it in the NFC East.  15. Falcons (4-10) Mathematically eliminated.  16. Panthers (4-10) Mathematically eliminated.', 33, '2020-12-27', 33, 33),
(34, 'Deâ€™Aaron Fox scores 24, Kings now 2-0 after 106-103 victory over Suns', 6, 'SACRAMENTO, Calif. (AP) â€” De\'Aaron Fox had 24 points and seven assists, Richaun Holmes and Buddy Hield combined for five free throws in the final two minutes and the Sacramento Kings held off the Phoenix Suns 106-103 on Saturday night.  Marvin Bagley III added 13 points and 11 rebounds, Harrison Barnes had 11 points and 11 rebounds, and Hield finished with 14 points for Sacramento.  Devin Booker scored 26 points for Phoenix. Chris Paul had 22 points and 12 assists.  â€œWe found a way to grind out a win,â€ Kings coach Luke Walton said. â€œThereâ€™s lots of games throughout an NBA season that are going to require that type of mentality. Give our guys a lot of credit for the effort they played with.â€  Three nights after beating Denver on a last-second tip-in by Hield in overtime, the Kings had to sweat out another close one.  Sacramento led 99-97 before Holmes scored on a three-point play with 1:43 remaining. Paul responded with a short jumper and free throw before Holmes made a pair from the stripe.  After Booker missed a jumper with 4.7 seconds left, Hield made two free throws. Paul then made a 3-pointer at the buzzer.  â€œI donâ€™t know if relieved is the right word.â€ Barnes said. â€œWe were just trying to maintain the edge that we had in that second half of that Denver game that really allowed us to kind of get over the hump and get that win. We were going to try to bring that into this game.â€  The loss ended the Sunsâ€™ nine-game winning streak dating to last season when Phoenix won its final eight games in the NBA bubble.  Suns coach Monty Williams was troubled by his teamâ€™s perimeter shooting and noted that Phoenix has to regroup quickly with another game in Sacramento on Sunday.  â€œItâ€™s going to be a matter of will,â€ Williams said. â€œBoth of us know each other. We have the fresh memory of tonightâ€™s game. Coming out tomorrow, itâ€™s going to be which team imposes its will on the other. We have to rise to the challenge.â€', 34, '2020-12-27', 34, 34),
(35, 'MLB Rumors: Red Sox pursuing free agent KikÃ© Hernandez', 6, 'KikÃ© Hernandez reportedly is the latest player to pop up on the Boston Red Sox\'s free-agency radar.  According to Chris Cotillo of MassLive.com, the Red Sox \"have strong interest\" in the former Los Angeles Dodgers utility man.  Tomase: Andriese ready to compete for a starting spot\' with Sox Hernandez has spent his last six seasons in L.A. primarily as a second baseman and outfielder. The 29-year-old has played every position except catcher since entering the league in 2014.  Last season with the World Series champions, Hernandez hit .230 with five home runs and a .680 OPS. His most productive season came in 2018 when he bashed 21 homers and posted a .806 OPS in 145 games.  Hernandez also has a connection to Alex Cora as the Red Sox manager was the general manager for Puerto Rico in the 2017 World Baseball Classic when Hernandez was on the team.  Second base is a position the Red Sox are expected to address this offseason, whether it be via free agency or a trade. Hernandez would be a strong candidate for the role with Michael Chavis, Christian Arroyo, and Jeter Downs as the team\'s current second base options.  Boston recently signed outfielder Hunter Renfroe and right-hander Matt Andriese to one-year deals.', 35, '2020-12-27', 35, 35);

